import React from 'react';

const SalesPrediction = ({ predictedSales }) => {
  return (
    <div>
      <h1>다음 달 판매 예측</h1>
      {predictedSales !== null ? (
        <p>25년 7월 판매량 예측 금액: {predictedSales.toLocaleString()} 원</p> // 천 단위 쉼표로 포맷팅
      ) : (
        <p>판매 예측을 불러오는 중입니다...</p> // 로딩 상태
      )}
    </div>
  );
}

export default SalesPrediction;
